import React from 'react';

function Box({ icon, title, description }: BoxProps) {
  return (
    <div className="bg-white p-6 rounded-lg shadow-md">
      <div className="flex items-center mb-4">
        <div className="mr-4">
          {icon}
        </div>
        <div>
          <h3 className="text-xl font-semibold text-gray-800">{title}</h3>
          <p className="text-gray-600">{description}</p>
        </div>
      </div>
      <button className="mt-4 px-4 py-2 bg-blue-500 text-white rounded-lg">Button</button>
    </div>
  );
}

export const Kursi = () => {
  return (
    <div className="container mx-auto px-6 mt-8">
      <div className="grid grid-cols-1 sm:grid-cols-3 gap-8">
        <Box
          icon={<svg className="w-8 h-8 fill-current text-gray-600" xmlns="http://www.w3.org/2000/svg" viewBox="0 0 24 24"><path d="M12 2C6.48 2 2 6.48 2 12s4.48 10 10 10 10-4.48 10-10S17.52 2 12 2zm0 18c-4.41 0-8-3.59-8-8s3.59-8 8-8 8 3.59 8 8-3.59 8-8 8z"/></svg>}
          title="Box 1"
          description="This is the description for Box 1."
        />
        <Box
          icon={<svg className="w-8 h-8 fill-current text-gray-600" xmlns="http://www.w3.org/2000/svg" viewBox="0 0 24 24"><path d="M21 9.5h-7V2H7v7.5H0L12 22l12-12h-7zM12 19.74l-8.25-8.25H7V4h10v7.49h3L12 19.74z"/></svg>}
          title="Box 2"
          description="This is the description for Box 2."
        />
        <Box
          icon={<svg className="w-8 h-8 fill-current text-gray-600" xmlns="http://www.w3.org/2000/svg" viewBox="0 0 24 24"><path d="M12 1L1 5.3V10h10V5h1V1zm1 2.16V5H22V1.53L13 3.15zM13 6H2v4.41L12 9.5l10 1.91V6h-7z"/></svg>}
          title="Box 3"
          description="This is the description for Box 3."
        />
      </div>
    </div>
  );
};
